contract CustomVestingWallet is VestingWallet {
    constructor(address beneficiaryAddress, address vestingManagerAddress)
        VestingWallet(beneficiaryAddress, vestingManagerAddress)
    {}

    /**
     * @dev Getter for the vesting initial unlock percentage.
     */
    function unlockPercentage() public view returns (uint256) {
        return IVestingManager(_vestingManagerAddress).unlockPercentage();
    }

    /**
     * @dev Virtual implementation of the vesting formula. This returns the amount vested, as a function of time, for
     * an asset given its total historical allocation.
     */
    function _vestingSchedule(uint256 totalAllocation, uint64 timestamp)
        internal
        view
        override
        returns (uint256)
    {
        if (timestamp < start()) {
            return 0;
        } else if (timestamp > start() + duration()) {
            return totalAllocation;
        } else {
            uint256 initialUnlocked = (totalAllocation * unlockPercentage()) /
                100;

            if (initialUnlocked >= totalAllocation) {
                return initialUnlocked;
            }

            uint256 vestingAmount = totalAllocation - initialUnlocked;
            return
                initialUnlocked +
                ((vestingAmount * (timestamp - start())) / duration());
        }
    }
}


