        view
        override
        returns (uint256[] memory amounts)
    {
        IPancakeRouter02 pancakeRouter = IPancakeRouter02(
            pancakeRouterAddress()
        );

        address[] memory path = new address[](2);
        path[0] = pancakeRouter.WETH();
        path[1] = busdAddress();

        return pancakeRouter.getAmountsOut(amountBNB, path);
    }

    function _swapBnbToBusd(uint256 minAmountOut)
        internal
        nonReentrant
        returns (uint256 amount)
    {
        IPancakeRouter02 pancakeRouter = IPancakeRouter02(
            pancakeRouterAddress()
        );

        address[] memory path = new address[](2);
        path[0] = pancakeRouter.WETH();
        path[1] = busdAddress();

        IERC20 busd = IERC20(busdAddress());
        uint256 balanceBefore = busd.balanceOf(address(this));

        pancakeRouter.swapExactETHForTokensSupportingFeeOnTransferTokens{
            value: msg.value
        }(minAmountOut, path, address(this), block.timestamp);

        uint256 balanceAfter = busd.balanceOf(address(this));

        return balanceAfter - balanceBefore;
    }

    function _execute(address beneficiary, uint256 amountWsi) internal {
        address walletAddress = _getVestingWalletAddress(beneficiary);

        _soldToken = _soldToken + amountWsi;
        emit TokenTransferred(walletAddress, amountWsi);
        emit TokenSold(beneficiary, amountWsi);

        IERC20 wsi = IERC20(wsiAddress());
        require(
            wsi.transfer(walletAddress, amountWsi),
            "Crowdsale: WSI transfer failed"
        );
    }

    function _getVestingWalletAddress(address beneficiary)
        private
        returns (address)
    {
        address existingWallet = _vestingWallets[beneficiary];

        if (existingWallet == address(0x0)) {
            CustomVestingWallet wallet = new CustomVestingWallet(
                beneficiary,
                vestingManagerAddress()
            );

            address walletAddress = address(wallet);
            _vestingWallets[beneficiary] = walletAddress;

            return walletAddress;
        } else {
            return existingWallet;
        }
    }

    /**
     * Validation
     */
    function _isWhitelisted(address beneficiary)
        private
        view
        returns (bool whitelisted)
    {
        if (!whitelistEnabled()) {
            return true;
        }

        return _whitelist[beneficiary];
    }

    function _preValidate() internal view {
        require(
            block.timestamp >= startTimestamp(),
            "Crowdsale: Sale isn't running yet"
        );

        require(
            block.timestamp < endTimestamp(),
            "Crowdsale: Sale was already finished"
        );

        require(
            _isWhitelisted(_msgSender()),
            "Crowdsale: Address not whitelisted"
        );
    }

    function _validateAmountUsd(uint256 amountUsd) internal view {
        require(
            amountUsd >= minAmountUsd(),
            "Crowdsale: Amount lower than min. amount"
        );

        require(
            amountUsd <= maxAmountUsd(),
            "Crowdsale: Amount exceeds max. amount"
        );
    }

    /**
     * Emergency Guard
     */
    function emergencyWithdraw(uint256 amount) external onlyOwner {
        super._emergencyWithdraw(amount);
    }

    function emergencyWithdrawToken(address token, uint256 amount)
        external
        onlyOwner
    {
        super._emergencyWithdrawToken(token, amount);
    }
}


