pragma solidity 0.8.17;



contract Crowdsale is BaseCrowdsale {
    constructor(
        address addressBusd,
        address addressUsdt,
        address addressWsi,
        address addressPancakeRouter,
        address addressVestingManager
    )
        BaseCrowdsale(
            addressBusd,
            addressUsdt,
            addressWsi,
            addressPancakeRouter,
            addressVestingManager
        )
    {}

    /**
     * Buying
     */
    function buyTokenBNB(uint256 minAmountBusd)
        external
        payable
        virtual
        override
    {
        _preValidate();

        uint256 amountBusd = _swapBnbToBusd(minAmountBusd);
        _validateAmountUsd(amountBusd);

        uint256 amountWsi = (amountBusd * 1000) / price();

        _execute(msg.sender, amountWsi);
    }

    function buyTokenBUSD(uint256 amountBusd) external virtual override {
        _buyTokenErc20(amountBusd, busdAddress());
    }

    function buyTokenUSDT(uint256 amountUsdt) external virtual override {
        _buyTokenErc20(amountUsdt, usdtAddress());
    }

    function _buyTokenErc20(uint256 amountUsd, address tokenAddress) private {
        _preValidate();
        _validateAmountUsd(amountUsd);

        IERC20 token = IERC20(tokenAddress);

        uint256 allowance = token.allowance(msg.sender, address(this));
        require(allowance >= amountUsd, "Crowdsale: amount exceeds allowance");

        require(
            token.transferFrom(msg.sender, address(this), amountUsd),
            "Crowdsale: token transfer failed"
        );

        uint256 amountWsi = (amountUsd * 1000) / price();

        _execute(msg.sender, amountWsi);
    }
}


